#pragma once

#include <cmath>
#include <arbor/version.hpp>
#include <arbor/mechanism_abi.h>

extern "C" {
  arb_mechanism_type make__NaV_type() {
    // Tables
    static arb_field_info globals[] = {{ "Con", "/ ms", 0.01, -.000000, .000000 },
        { "Coff", "/ ms", 40, -.000000, .000000 },
        { "Oon", "/ ms", 8, -.000000, .000000 },
        { "Ooff", "/ ms", 0.05, -.000000, .000000 },
        { "alpha", "/ ms", 400, -.000000, .000000 },
        { "beta", "/ ms", 12, -.000000, .000000 },
        { "gamma", "/ ms", 250, -.000000, .000000 },
        { "delta", "/ ms", 60, -.000000, .000000 },
        { "alfac", "", 2.51, -.000000, .000000 },
        { "btfac", "", 5.32, -.000000, .000000 },
        { "x1", "mV", 24, -.000000, .000000 },
        { "x2", "mV", -24, -.000000, .000000 } };
    static arb_size_type n_globals = 12;
    static arb_field_info state_vars[] = {{ "C1", "", NAN, -.000000, .000000 },
        { "C2", "", NAN, -.000000, .000000 },
        { "C3", "", NAN, -.000000, .000000 },
        { "C4", "", NAN, -.000000, .000000 },
        { "C5", "", NAN, -.000000, .000000 },
        { "I1", "", NAN, -.000000, .000000 },
        { "I2", "", NAN, -.000000, .000000 },
        { "I3", "", NAN, -.000000, .000000 },
        { "I4", "", NAN, -.000000, .000000 },
        { "I5", "", NAN, -.000000, .000000 },
        { "O", "", NAN, -.000000, .000000 },
        { "I6", "", NAN, -.000000, .000000 },
        { "qt", "", NAN, -.000000, .000000 } };
    static arb_size_type n_state_vars = 13;
    static arb_field_info parameters[] = {{ "gbar", "S / cm2", .015, -.000000, .000000 } };
    static arb_size_type n_parameters = 1;
    static arb_ion_info ions[] = {{ "na", false, false, false, false, true, false, false, 0 } };
    static arb_size_type n_ions = 1;

    arb_mechanism_type result;
    result.abi_version=ARB_MECH_ABI_VERSION;
    result.fingerprint="<placeholder>";
    result.name="NaV";
    result.kind=arb_mechanism_kind_point;
    result.is_linear=false;
    result.has_post_events=false;
    result.globals=globals;
    result.n_globals=n_globals;
    result.ions=ions;
    result.n_ions=n_ions;
    result.state_vars=state_vars;
    result.n_state_vars=n_state_vars;
    result.parameters=parameters;
    result.n_parameters=n_parameters;
    return result;
  }

  arb_mechanism_interface* make__NaV_interface_multicore();
  arb_mechanism_interface* make__NaV_interface_gpu();

  #ifndef ARB_GPU_ENABLED
  arb_mechanism_interface* make__NaV_interface_gpu() { return nullptr; }
  #endif

  arb_mechanism make__NaV() {
    static arb_mechanism result = {};
    result.type  = make__NaV_type;
    result.i_cpu = make__NaV_interface_multicore;
    result.i_gpu = make__NaV_interface_gpu;
    return result;
  }
} // extern C
